import { NavLink } from "react-router-dom";
const NotFound = () => {
    return(
        <div>
            <h1>404 Not found</h1>
            <ul>
                <li><NavLink to='/'>Home</NavLink></li>
                <li><NavLink to='LogIn'>LogIn</NavLink></li>
            </ul>
        </div>
        
    )
}

export default NotFound;
